modules/vpc/variables.tf.code:
variable "vpc_cidr" {
  description = "The CIDR block for the VPC."
  type        = string
}

variable "public_subnets" {
  description = "A list of public subnets inside the VPC."
  type        = list(string)
}

variable "private_subnets" {
  description = "A list of private subnets inside the VPC."
  type        = list(string)
}

variable "availability_zones" {
  description = "A list of availability zones in the region"
  type        = list(string)
}

variable "enable_dns_hostnames" {
  description = "Should be true to enable DNS hostnames in the VPC."
  default     = true
}

variable "enable_dns_support" {
  description = "Should be true to enable DNS support in the VPC."
  default     = true
}

modules/vpc/vpc.tf.code:
resource "aws_vpc" "main" {
  cidr_block           = var.vpc_cidr
  enable_dns_hostnames = var.enable_dns_hostnames
  enable_dns_support   = var.enable_dns_support

  tags = {
    Name = "main-vpc"
  }
}

resource "aws_subnet" "public" {
  count                   = length(var.public_subnets)
  vpc_id                  = aws_vpc.main.id
  cidr_block              = var.public_subnets[count.index]
  availability_zone       = var.availability_zones[count.index]
  map_public_ip_on_launch = true

  tags = {
    Name = "public-subnet-${count.index}"
  }
}

resource "aws_subnet" "private" {
  count             = length(var.private_subnets)
  vpc_id            = aws_vpc.main.id
  cidr_block        = var.private_subnets[count.index]
  availability_zone = var.availability_zones[count.index]

  tags = {
    Name = "private-subnet-${count.index}"
  }
}

resource "aws_internet_gateway" "gw" {
  vpc_id = aws_vpc.main.id

  tags = {
    Name = "main-gateway"
  }
}

resource "aws_route_table" "public" {
  vpc_id = aws_vpc.main.id

  tags = {
    Name = "public-route-table"
  }
}

resource "aws_route_table_association" "public" {
  count          = length(var.public_subnets)
  subnet_id      = aws_subnet.public[count.index].id
  route_table_id = aws_route_table.public.id
}

resource "aws_route" "public_internet_access" {
  route_table_id         = aws_route_table.public.id
  destination_cidr_block = "0.0.0.0/0"
  gateway_id             = aws_internet_gateway.gw.id
}

# ... Additional resources like NAT Gateways, Private Route Tables, etc. can be added as needed.

modules/vpc/outputs.tf.code:
output "vpc_id" {
  description = "The ID of the VPC."
  value       = aws_vpc.main.id
}

output "public_subnet_ids" {
  description = "The IDs of the public subnets."
  value       = aws_subnet.public[*].id
}

output "private_subnet_ids" {
  description = "The IDs of the private subnets."
  value       = aws_subnet.private[*].id
}

modules/ec2/variables.tf.code:
variable "ami_id" {
  description = "The AMI ID for the EC2 instances."
  type        = string
}

variable "instance_type" {
  description = "The type of instance to start."
  type        = string
}

variable "key_name" {
  description = "The key name of the Key Pair to use for the instance."
  type        = string
}

variable "vpc_id" {
  description = "The VPC ID where the EC2 instances will reside."
  type        = string
}

variable "security_groups" {
  description = "A list of security group IDs to associate with."
  type        = list(string)
}

variable "subnet_ids" {
  description = "A list of subnet IDs to launch resources in."
  type        = list(string)
}

variable "desired_capacity" {
  description = "The number of Amazon EC2 instances that should be running in the group."
  type        = number
}

variable "min_size" {
  description = "The minimum size of the group."
  type        = number
}

variable "max_size" {
  description = "The maximum size of the group."
  type        = number
}

variable "user_data" {
  description = "The user data to provide when launching the instances."
  type        = string
  default     = ""
}

variable "tags" {
  description = "A map of tags to add to all resources."
  type        = map(string)
  default     = {}
}

modules/ec2/ec2.tf.code:
resource "aws_security_group" "ec2_sg" {
  name        = "ec2-security-group"
  description = "Security Group for EC2 instances"
  vpc_id      = var.vpc_id
}

# Assume this security group allows for HTTP and SSH access.
# This is just an example. Modify the rules as necessary for your actual requirements.
resource "aws_security_group_rule" "allow_http" {
  type        = "ingress"
  from_port   = 80
  to_port     = 80
  protocol    = "tcp"
  cidr_blocks = ["0.0.0.0/0"]
  security_group_id = aws_security_group.ec2_sg.id
}

resource "aws_security_group_rule" "allow_ssh" {
  type        = "ingress"
  from_port   = 22
  to_port     = 22
  protocol    = "tcp"
  cidr_blocks = ["0.0.0.0/0"]
  security_group_id = aws_security_group.ec2_sg.id
}

# Setup an application load balancer
resource "aws_lb" "app_lb" {
  name               = "app-lb"
  internal           = false
  load_balancer_type = "application"
  security_groups    = [aws_security_group.ec2_sg.id]
  subnets            = var.subnet_ids

  enable_deletion_protection = false

  tags = merge(
    var.tags,
    {
      Name = "app-lb"
    },
  )
}

# Launch configuration for autoscaling group
resource "aws_launch_configuration" "app_lc" {
  name_prefix          = "app-lc-"
  image_id             = var.ami_id
  instance_type        = var.instance_type
  security_groups      = [aws_security_group.ec2_sg.id]
  key_name             = var.key_name
  user_data            = var.user_data

  lifecycle {
    create_before_destroy = true
  }
}

# Autoscaling group
resource "aws_autoscaling_group" "app_asg" {
  launch_configuration = aws_launch_configuration.app_lc.id
  vpc_zone_identifier  = var.subnet_ids
  desired_capacity     = var.desired_capacity
  min_size             = var.min_size
  max_size             = var.max_size

  tag {
    key                 = "Name"
    value               = "app-instance"
    propagate_at_launch = true
  }

  tags = [
    for k, v in var.tags : {
      key                 = k
      value               = v
      propagate_at_launch = true
    }
  ]
}

# ... Attach app_asg to app_lb, configure listeners and target groups

modules/ec2/outputs.tf.code:
output "autoscaling_group_name" {
  description = "The name of the autoscaling group."
  value       = aws_autoscaling_group.app_asg.name
}

output "load_balancer_dns_name" {
  description = "The DNS name of the load balancer."
  value       = aws_lb.app_lb.dns_name
}

output "security_group_id" {
  description = "The ID of the security group."
  value       = aws_security_group.ec2_sg.id
}
